/**
 * Created by abhiram on 7/1/20.
 */

import React from 'react';
import {getItemLocalStorage} from '../../Utils/Util';
import {Link} from "react-router-dom";
import LogoutComponent from "../Login/LogoutComponent";
import {Nav,NavDropdown} from 'react-bootstrap';

const MenuComponent = () => {

    let permissions = JSON.parse(getItemLocalStorage('menu_permission'));
    let permissionArray = Object.keys(permissions).map(i => permissions[i]);

    return (
        <div className="header">
            <div className="header-menu">
                <div className="fresh-trak-logo">FreshTrak</div>
                <Nav>
                    <Link to="/dashboard">Home</Link>
                    { permissionArray.map((value, index) => {
                        return (
                            <NavDropdown title={value[0].menu_name} key={index} id="nav-dropdown">

                                {
                                    value.map((valueInner, indexInner) => {
                                        return (<NavDropdown.Item className="sub-menu" key={indexInner}><Link
                                                to={valueInner.menu_link}>{valueInner.sub_menu_name}</Link></NavDropdown.Item>
                                        )
                                    })

                                }
                            </NavDropdown>
                        )
                    })}
                </Nav>
                <LogoutComponent/>
            </div>
        </div>
    )
};

export default MenuComponent;
